import Container from '../components/Container'
import Head from 'next/head'
const About = () => {
    return (
        <Container>
            <Head>
                <title>Next.js ProJects - About</title>
            </Head>
            <h1>About</h1>
            <p>This is our web page :)</p>
        </Container>
    )
}
export default About;
